import {
    BottomNavigation,
    BottomNavigationAction,
    Paper,
} from "@mui/material";
import React from "react";
import { useNavigate } from "react-router-dom";
import ROUTES from "../routes/routesModel";
import InfoIcon from "@mui/icons-material/Info";
import HomeIcon from "@mui/icons-material/Style";
import MoreHorizIcon from '@mui/icons-material/MoreHoriz';
import CallIcon from '@mui/icons-material/Call'; // Import the phone icon

export default function Footer() {
    const navigate = useNavigate();

    return (
        <>
            <Paper
                sx={{ position: "sticky", bottom: 0, left: 0, right: 0 }}
                elevation={3}
            >
                <BottomNavigation showLabels>
                    <BottomNavigationAction
                        label="עוד"
                        icon={<MoreHorizIcon />} // Use the new icon
                        onClick={() => navigate(ROUTES.MORE)} // Navigate to the new route
                    />
                    <BottomNavigationAction
                        label="קו-חם"
                        icon={<CallIcon />} // Use the phone icon
                        onClick={() => navigate(ROUTES.PHONE_POPUP)} // Navigate to the new route
                    />
                    <BottomNavigationAction
                        label="Dashboard"
                        icon={<InfoIcon />}
                        onClick={() => navigate(ROUTES.DASHBOARD)}
                    />
                    <BottomNavigationAction
                        label="בית"
                        icon={<HomeIcon />}
                        onClick={() => navigate(ROUTES.ROOT)}
                    />
                </BottomNavigation>
            </Paper>
        </>
    );
}
